// Complete the funGame function below.
function funGame(a, b) {
    let sumA = BigInt(0), sumB = BigInt(0);
    let abArr = a.map((element, index) => {
        return { a: a[index], b: b[index], index: index };
    })
    abArr.sort((e1, e2) => e2.a + e2.b - e1.a - e1.b);

    let pickedIndexes = new Set(), isTurnOfFirst;
    for (let i = 0; i < a.length; i++) {
        isTurnOfFirst = (i % 2 === 0);
        let topElement = abArr.find(element => !pickedIndexes.has(element.index));
        pickedIndexes.add(topElement.index);

        if (isTurnOfFirst === true)
            sumA += BigInt(topElement.a);
        else
            sumB += BigInt(topElement.b);
    }

    if (sumA > sumB)
        return 'First';
    else if (sumA === sumB)
        return 'Tie';
    else
        return 'Second';
}

